import React, { useState } from "react";
import { TextField, Button, Box } from '@mui/material';
import Card from "@mui/material/Card";
import { Grid } from "@mui/material";


const initialState = {
  name: '',
  email: '',
  message: '',
}

const MaterialFormComponent = (props) => {
  const [{ name, email, message }, setState] = useState(initialState)

  const handleChange = (e) => {
    const { name, value } = e.target
    setState((prevState) => ({ ...prevState, [name]: value }))
  }
  const clearState = () => setState({ ...initialState })

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(name, email, message)
  }
    return (
    <form onSubmit={handleSubmit} >
      <Card elevation={4} 
      direction="row"
      justifyContent="flex-start"
      alignItems="center"
      spacing={1}
      sx={{width: "98%", height: "550px", padding: "50px", borderRadius: "5px", border: "2px solid green"}}
      > 
          <Box sx={{border: "2px solid yellow", width: "100%"}}>
              <Grid container alignItems="center" justify="center" direction="column" >
                  <Grid item>
                      <TextField
                        sx={{width: "200px"}}
                        id="firstName"
                        name="name"
                        label="First name"
                        type="text"
                        value={initialState.name}
                        onChange={handleChange}
                      />
                  </Grid>
                  <Grid item>
                      <TextField
                        id="lastName"
                        name="email"
                        label="Last name"
                        type="text"
                        value={initialState.email}
                        onChange={handleChange}
                      />
                  </Grid>
              </Grid>
              <Grid container alignItems="center" justify="center" direction="column" >
                <Grid item>
                    <TextField
                      id="lastName"
                      name="message"
                      label="Last name"
                      type="text"
                      value={initialState.message}
                      onChange={handleChange}
                    />
                </Grid>
                <Grid item>
                    <Button variant="contained" color="primary" type="submit" style={{
                        backgroundColor: "green",
                        margin: "5px"
                    }}>
                        Submit
                    </Button>
                </Grid>
              </Grid>
          </Box>
      </Card>
    </form>

    );
}
export default MaterialFormComponent;
